package sphincsplus

import (
	"encoding/hex"
	"testing"

	"github.com/stretchr/testify/require"
)

func TestSignVerifyVector(t *testing.T) {
	/*
		privKey1, pubKey1 := NewKeypair()
		message := []byte("i am a message")
		sig1 := privKey1.Sign(message)
		require.True(t, pubKey1.Verify(sig1, message))

		t.Logf("priv key %x", privKey1.Bytes())
		t.Logf("pub key %x", pubKey1.Bytes())
		t.Logf("sig %x", sig1)
	*/

	privKey := new(PrivateKey)
	privKeyBytes, err := hex.DecodeString("b1009776416e420428df58b80f27fb48d044c785a85d9a72bb89eceec802a48bde57f4f34732524c52a4fb8cbcb93076ad0d329bfb9e13d0a84310dd1aa7bb7429ae8dc5cfe2205a3dfbb992e0e11d3ff637e24b9c1958fc1bed10988a09668c8f02a7fd005e6cb984d1261baf846c0d980be80ed0b9c03eb26292c46c0e525c")
	require.NoError(t, err)
	err = privKey.FromBytes(privKeyBytes)
	require.NoError(t, err)

	pubKey := new(PublicKey)
	pubKeyBytes, err := hex.DecodeString("29ae8dc5cfe2205a3dfbb992e0e11d3ff637e24b9c1958fc1bed10988a09668c8f02a7fd005e6cb984d1261baf846c0d980be80ed0b9c03eb26292c46c0e525c")
	require.NoError(t, err)
	err = pubKey.FromBytes(pubKeyBytes)

	signature, err := hex.DecodeString("")
	require.NoError(t, err)

	message := []byte("i am a message")
	require.True(t, pubKey.Verify(signature, message))

}
